PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE alembic_version (
	version_num VARCHAR(32) NOT NULL
);
CREATE TABLE "articleTypeSettings" (
	id INTEGER NOT NULL, 
	name VARCHAR(64), 
	protected BOOLEAN, 
	hide BOOLEAN, 
	PRIMARY KEY (id), 
	UNIQUE (name), 
	CHECK (protected IN (0, 1)), 
	CHECK (hide IN (0, 1))
);
CREATE TABLE blog_info (
	id INTEGER NOT NULL, 
	title VARCHAR(64), 
	signature TEXT, 
	navbar VARCHAR(64), 
	PRIMARY KEY (id)
);
CREATE TABLE blog_view (
	id INTEGER NOT NULL, 
	num_of_view BIGINT, 
	PRIMARY KEY (id)
);
CREATE TABLE menus (
	id INTEGER NOT NULL, 
	name VARCHAR(64), 
	"order" INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (name)
);
CREATE TABLE plugins (
	id INTEGER NOT NULL, 
	title VARCHAR(64), 
	note TEXT, 
	content TEXT, 
	"order" INTEGER, 
	disabled BOOLEAN, 
	PRIMARY KEY (id), 
	UNIQUE (title), 
	CHECK (disabled IN (0, 1))
);

