CREATE TABLE sources (
	id INTEGER NOT NULL, 
	name VARCHAR(64), 
	PRIMARY KEY (id), 
	UNIQUE (name)
);
CREATE TABLE "articleTypes" (
	id INTEGER NOT NULL, 
	name VARCHAR(64), 
	introduction TEXT, 
	menu_id INTEGER, 
	setting_id INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(menu_id) REFERENCES menus (id), 
	FOREIGN KEY(setting_id) REFERENCES "articleTypeSettings" (id), 
	UNIQUE (name)
);
CREATE TABLE articles (
	id INTEGER NOT NULL, 
	title VARCHAR(64), 
	content TEXT, 
	summary TEXT, 
	create_time DATETIME, 
	update_time DATETIME, 
	num_of_view INTEGER, 
	"articleType_id" INTEGER, 
	source_id INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY("articleType_id") REFERENCES "articleTypes" (id), 
	FOREIGN KEY(source_id) REFERENCES sources (id), 
	UNIQUE (title)
);

