CREATE TABLE comments (
	id INTEGER NOT NULL, 
	content TEXT, 
	timestamp DATETIME, 
	author_name VARCHAR(64), 
	author_email VARCHAR(64), 
	avatar_hash VARCHAR(32), 
	article_id INTEGER, 
	disabled BOOLEAN, 
	comment_type VARCHAR(64), 
	reply_to VARCHAR(128), 
	PRIMARY KEY (id), 
	FOREIGN KEY(article_id) REFERENCES articles (id), 
	CHECK (disabled IN (0, 1))
);
CREATE TABLE follows (
	follower_id INTEGER NOT NULL, 
	followed_id INTEGER NOT NULL, 
	PRIMARY KEY (follower_id, followed_id), 
	FOREIGN KEY(followed_id) REFERENCES comments (id), 
	FOREIGN KEY(follower_id) REFERENCES comments (id)
);
CREATE TABLE user (
    "id" INTEGER AUTOINCREMENT NOT NULL,
    "email" VARCHAR(64),
    "username" VARCHAR(64),
    "password_hash" VARCHAR(128),
    "avatar_hash" VARCHAR(32),
    "userlevel" VARCHAR(32) NOT NULL DEFAULT ('user')
);
CREATE INDEX ix_articles_create_time ON articles (create_time);
CREATE INDEX ix_articles_update_time ON articles (update_time);
CREATE UNIQUE INDEX ix_user_email ON user (email);
CREATE UNIQUE INDEX ix_user_username ON user (username);
COMMIT;
